Eccomi con una nuova proposta 😏
Per prepararle vi serviranno:
➡️30 gr di farina d'avena aromatizzata alla nocciola @iafstoreitalia 
➡️50 ml di latte al cocco @adezitalia 
➡️100 gr di albumi @lenaturelleofficial
Farcite con:
➡️1 yogurt greco @fage_italia trublend al cocco (è illegale, ha le scaglie all'interno 🤤)
➡️20 ml di latte di cocco circa per renderlo più cremoso
Topping fatto con:
➡️10 gr di cacao amaro
➡️3-5 gr di scaglie di cocco
.
Con l'aggiunta di un frutto la colazione è di circa 400 kcal✌️
