Buongiorno ragazzi e buon venerdì ✨
L aria di weekend si fa sentire e proprio perché questo fine settimana sarò per lo più a lavoro, ho bisogno di coccolarmi con una colazione che mi stra carica di energie! Oggi la proposta per #lagolositadelvenerdi  è un rotolo con ricotta e pere, uno dei miei dolci preferiti fatti in mille modi diversi in pasticceria a lavoro. Questa versione è semplice e si mantiene per due giorni in frigo. Potete inoltre decidere di congelarla e mangiarla come gelato 😍 è fantastico ugualmente! Sfogliate le foto per la ricetta e vi auguro una bellissima giornata ✨

